  if (item.json.icp) icp = item.json.icp;
}

return [{ json: { leads, icp } }];

return items.map(item => {
  const matchPercent = item.json.matchPercent;

  let category = 'No Fit';
  if (matchPercent >= 0.75) category = 'Best Fit';
  else if (matchPercent >= 0.5) category = 'Medium Fit';

  item.json.category = category;
  return item;
});

