const items = $input.all();

return items.map(({ json }) => {
  const sendex = json.sendex;
  const result = json.result;
  const reason = json.reason;
  const  email=  json.email ;

  let verified;

  if (result === "deliverable" || sendex === 1) {
    verified = "Verified";
  } else if (sendex > 0.7 || reason === "low_deliverability") {
    verified = "Semi-Verified";
  } else {
    verified = "Risky";
  }

  return {
    json: {
      email: email ,
      verified: verified
    }
  };
});

